  // 다른 페이지들의 부모같은 느낌
const App = ({Component}) =>{
return(
    <>
    <Head>
        <meta charSet="utf-8" />
        <title>NodeBird</title>
    </Head>
    <Component />
    </>

)
};

App.proptypes={
    Component:PropTypes.elementType.isRequired,
}
export default App;
